import React, { useState, useEffect } from 'react';
import { DataTable } from 'primereact/datatable';
import { Dropdown } from 'primereact/dropdown'
import { Column } from 'primereact/column';
import { ProductService } from './service/ProductService';
import { MunicipioDataService }  from './service/municipio.service';

export default function BasicDemo() {
    /*const [products, setProducts] = useState([]);

    useEffect(() => {
        ProductService.getProductsMini().then(data => setProducts(data));
    }, []);*/

    const [municipios, setMunicipios] = useState([]);

    const [selectedCity, setSelectedCity] = useState(null);
    const cities = [
        { name: 'New York', code: 'NY' },
        { name: 'Rome', code: 'RM' },
        { name: 'London', code: 'LDN' },
        { name: 'Istanbul', code: 'IST' },
        { name: 'Paris', code: 'PRS' }
    ];
    /*useEffect(() => {
        MunicipioDataService.getAll().then(data => setMunicipios(data));
    }, []);*/

    useEffect(() => {
      fetch('http://localhost:8080/api/municipios')
        .then(response => response.json())
        .then(municipios => setMunicipios(municipios));
    }, []);

    useEffect(() => {
        fetch('http://localhost:8080/api/zonas')
          .then(response => response.json())
          .then(data => setData(data));
      }, []);

    /*useEffect(() => {
        MunicipioDataService.getAll().then(data => setData(data));
    }, []);*/

    return (
        /*<div className="card flex justify-content-center">
            <Dropdown value={selectedCity} onChange={(e) => setSelectedCity(e.value)} options={cities} optionLabel="name" 
                placeholder="Select a City" className="w-full md:w-14rem" />
        </div>*/
        <div className="card">
            <DataTable value={municipios} tableStyle={{ minWidth: '50rem' }} rows={5} paginator>
                <Column field="ID" sortable header="Code"></Column>
                <Column field="NOME" sortable header="Name"></Column>
            </DataTable>
        </div>

    );
}
